import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';  // Importe useParams

export default function DeveloperDetails() {
    const [developer, setDeveloper] = useState(null);
    const { id } = useParams();  // Use useParams para acessar o id

    useEffect(() => {
        axios.get(`http://localhost:8000/api/devs/${id}`)
            .then(response => {
                setDeveloper(response.data);
            })
            .catch(error => {
                console.error('Erro ao buscar desenvolvedor:', error);
            });
    }, [id]);  

    return (
        <div>
            {developer ? (
                <div>
                    <h1>Detalhes do Desenvolvedor: {developer.name}</h1>
                    <p>Nickname: {developer.nickname}</p>
                    <p>Data de Nascimento: {developer.birth_date}</p>
                    <p>Pilha Tecnológica: {developer.stack ? developer.stack.join(', ') : 'Nenhuma'}</p>
                </div>
            ) : (
                <p>Não há develçoper</p>
            )}
        </div>
    );
}
